import React from 'react';
import {Link} from "react-router-dom";

const NavBar = () => {

    return (
        <nav className="navigation">
            <ul className="nav-ul">
                <li className="nav-li">
                    <Link to='/'>Home</Link>
                </li>
                <li className="nav-li">
                    <Link to='/profiles'>Profiles</Link>
                </li>
            </ul>
        </nav>
    );
};

export default NavBar;
